import { BrowserRouter, Link, Route, Router, Routes } from "react-router-dom";
import { Header } from "./components/Header";
import Main from "./components/main";
import { Existing } from "./pages/Extisting";

function App() {
  return (
    <div className="app">
      <Login />
    </div>
  );
}
function Login() {
  return (
    <div>
      <BrowserRouter>
        <Router>
          <Routes>
            <Route path="/pages" element={<Existing />} />
          </Routes>

          <Header />
          <Link to={"/pages"}>Existing</Link>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
